create database store;
use store;

CREATE TABLE menu
(
  MenuID INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
  MenuName VARCHAR(50)
);
CREATE TABLE product
(
  ProductID VARCHAR(50) PRIMARY KEY NOT NULL,
  ProductName VARCHAR(70),
  ProductPrice DOUBLE,
  ProductPictureUrl VARCHAR(50),
  SubMenuID INT
);
CREATE TABLE settedmenu
(
  SettedMenuID INT PRIMARY KEY NOT NULL
);
CREATE TABLE settedproduct
(
  SettedProductId VARCHAR(50) PRIMARY KEY NOT NULL
);
CREATE TABLE settedsubmenu
(
  SettedSubMenuID INT PRIMARY KEY NOT NULL,
  MenuID INT
);
CREATE TABLE submenu
(
  SubMenuID INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
  SubMenuName VARCHAR(50),
  MenuID VARCHAR(50)
);
CREATE TABLE user
(
  UserId INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
  FirstName VARCHAR(50) DEFAULT '' NOT NULL,
  LastName VARCHAR(50),
  Email VARCHAR(50) DEFAULT '' NOT NULL,
  Phone VARCHAR(50),
  Password VARCHAR(50)
);
























